@keyframes play {
  0%   {border-color: #333;color:#fff;}
  50%  {border-color: lime;color:lime;}
  100% {border-color: #333;color:#fff;}
}
@keyframes record {
  0%   {border-color: #333;color:red;}
  50%  {border-color: red;color:#ff000060;border-style: solid;border-width:4px;}
  100% {border-color: #333;color:red;}
}

